import React from "react";
import HomeButton from "./HomeButton";
import RestartButton from "./RestartButton";
import ResultButton from "./ResultButton";

const SubButtonGroup = () => {
  return (
    <>
      <HomeButton />
      <ResultButton />
      <RestartButton />
    </>
  );
};

export default SubButtonGroup;
